import React, { Component } from 'react';

class YouTubeComp extends Component {
    render() {
        return (
            <div>
                <iframe
                    src={this.props.vidSource}
                    title={this.props.vidTitle}
                    style={{
                        height: '400px',
                        width: '600px'
                    }}
                ></iframe>
            </div>
        );
    }
}

export default YouTubeComp;
